import React from 'react';
import './ErrorPopup.css';
import { Link } from 'react-router-dom'

function ErrorPopup() {
    return (
        <div className="error-popup">
            <Link to="/" className="error-popup__link">Назад</Link>
        </div>
    )
}

export default ErrorPopup;
